'use babel'

const fs = require('fs');
const jsdom = require('jsdom');
const {
    JSDOM
} = jsdom;
const cfd = require('cumulative-flow');
const moment = require('moment');

const NOW = '2018-09-11';
const EXPECT1 = 'data:image/svg+xml;base64,';
const EXPECT2 = 'data:image/svg+xml;base64,';
const EXPECT3 = 'data:image/svg+xml;base64,';
const EXPECT4 = 'data:image/svg+xml;base64,';
const EXPECT5 = 'data:image/svg+xml;base64,';
const EXPECT6 = 'data:image/svg+xml;base64,';
const EXPECT7 = 'data:image/svg+xml;base64,';
const EXPECT8 = 'data:image/svg+xml;base64,';
const EXPECT9 = 'data:image/svg+xml;base64,';

const EXPECT = [EXPECT1, EXPECT2, EXPECT3, EXPECT4, EXPECT5, EXPECT6, EXPECT7, EXPECT8, EXPECT9];

let actual = [];

// helper functions
function makeTestSettings() {
    settings = {};
    settings.data = makeTestData();
    settings.svg = JSDOM.fragment('<svg></svg>').firstChild;
    settings.predict = settings.data.entries[0].date;
    settings.markers = [{
        date: settings.data.entries[1].date
    }, {
        date: settings.data.entries[3].date
    }, {
        date: settings.data.entries[5].date
    }]
    let now = moment(NOW);
    settings.title = 'Testing the cfd'
    settings.fromDate = moment(now).subtract(8, 'days');
    settings.toDate = moment(now).add(3, 'days');
    return settings;
}

function makeTestData() {
    let testData = {};
    let now = moment(NOW);
    testData.toDo = ['new'];
    testData.progress = ['test', 'dev'];
    testData.done = ['done'];
    testData.unit = 'points';
    testData.entries = [];
    testData.entries.push({
        date: moment(now).subtract(8, 'days'),
        new: 0,
        dev: 0,
        test: 0,
        done: 0,
    }, {
            date: moment(now).subtract(7, 'days'),
            new: 1,
            dev: 0,
            test: 0,
            done: 0,
        }, {
            date: moment(now).subtract(6, 'days'),
            new: 1,
            dev: 1,
            test: 0,
            done: 0
        }, {
            date: moment(now).subtract(5, 'days'),
            new: 1,
            dev: 0,
            test: 1,
            done: 1
        }, {
            date: moment(now).subtract(4, 'days'),
            new: 2,
            dev: 1,
            test: 0,
            done: 2
        }, {
            date: moment(now).subtract(3, 'days'),
            new: 1,
            dev: 1,
            test: 2,
            done: 2
        }, {
            date: moment(now).subtract(2, 'days'),
            new: 0,
            dev: 0,
            test: 1,
            done: 5
        }, {
            date: moment(now).subtract(1, 'days'),
            new: 1,
            dev: 1,
            test: 0,
            done: 5
        }

    );
    return testData;
}


function writeTestFile(path, content) {
    fs.writeFile(path, content);
}

