test('write test results into file', () => {
    let testFileContent = '<!DOCTYPE html>\n<meta charset="utf-8">\n'
        + '<body><style>* {font-family:sans-serif;}\n'
        + '.image-set {border-bottom: 1px solid black; padding:2em 0;}\n'
        + '.label {text-transform:uppercase; color:white; background:gray; margin:0 1em;}\n'
        + '.label.mismatch {color:white; background:red;}\n'
        + '.label.expected {color:white; background:green;}\n'
        + '.box {display:inline-block;}</style>'
        + '<h1>Expected Test Results with Actual Values</h1>';

    for (let i = 0; i < EXPECT.length; i++) {
        let match = EXPECT[i] == actual[i];
        if (match) {
            testFileContent += '<div class="image-set"><div class="box"><div class="label">Expected ' + (i+1) + '</div><img id="expect' + (i+1) + '" src="' + EXPECT[i] + '"/></div>'
                + '<div class="box"><div class="label expected">Actual ' + (i+1) + ' is as expected</div><img id="actual' + (i+1) + '" src="' + actual[i] + '"/></div></div>';
        } else {
            testFileContent += '<div class="image-set"><div class="box"><div class="label">Expected ' + (i+1) + '</div><img id="expect' + (i+1) + '" src="' + EXPECT[i] + '"/></div>'
                + '<div class="box"><div class="label mismatch">Actual ' + (i+1) + ' has a mismatch</div><img id="actual' + (i+1) + '" src="' + actual[i] + '"/></div></div>';

        }
    }
    testFileContent += '</body';
    writeTestFile('./cfd.html', testFileContent);

    //have a look at ./cfd.html to view the result
});




